import{_ as o,c as i,o as e,ag as a}from"./chunks/framework.26XVkPZQ.js";const m=JSON.parse('{"title":"社区介绍","description":"","frontmatter":{},"headers":[],"relativePath":"intro/index.md","filePath":"intro/index.md"}'),d={name:"intro/index.md"};function n(s,t,r,l,c,p){return e(),i("div",null,t[0]||(t[0]=[a('<h1 id="社区介绍" tabindex="-1">社区介绍 <a class="header-anchor" href="#社区介绍" aria-label="Permalink to &quot;社区介绍&quot;">​</a></h1><p>Godot Hub是国内领先的游戏引擎社区，拥有包括公众号、论坛、桌面软件、微信/QQ/Discord社群在内的一系列平台，专为Godot开发者服务。</p><p>作为国内Godot社区的代表，Godot Hub一直致力于推动Godot游戏引擎在中国的广泛应用与深入发展。自2023年起，Godot Hub每年举办一场开发大赛（<a href="/intro/festival/">Godot Hub Festival</a>），现已成为国内Godot游戏引擎社区规模最大的比赛。</p><p>Godot Hub和Godot官方保持了密切的联系。Godot Hub论坛里有很多大佬积极地为Godot引擎贡献代码、完善文档；在我们的桌面软件因莫须有的问题被微软下架时，Godot基金会为我们出具了证明文件，帮助我们合规地使用Godot Hub作为名称；在我们提交PR将社区信息更新到Godot官方网站时，基金会负责人Emi用中文回复<code>谢谢你！</code>向我们问好。</p><h2 id="合作伙伴" tabindex="-1">合作伙伴 <a class="header-anchor" href="#合作伙伴" aria-label="Permalink to &quot;合作伙伴&quot;">​</a></h2><div class="partner-section"><div class="partner-container"><div class="partner-item"><img src="https://godothub.atomgit.net/public/licon/openatom/alpha.png" alt="openatom" style="width:65%;"></div><div class="partner-item"><img src="https://godothub.atomgit.net/public/licon/openkylin.png" alt="openkylin" style="width:60%;"></div><div class="partner-item"><img src="https://godothub.atomgit.net/public/licon/csdn.png" alt="csdn" style="width:42%;"></div><div class="partner-item"><img src="https://godothub.atomgit.net/public/licon/gitcode.png" alt="gitcode" style="width:60%;"></div><div class="partner-item"><img src="https://godothub.atomgit.net/public/licon/deepin.png" alt="deepin" style="width:60%;"></div></div></div>',6)]))}const u=o(d,[["render",n]]);export{m as __pageData,u as default};
